import React, { useState } from 'react';

import TestComponent from '../../components/testcomponent/testcomponent';

import './testpage.css'

const TestPage = () => {
   const [leftTestEnabled, setLeftTestEnabled] = useState(true);
   const [rightTestEnabled, setRightTestEnabled] = useState(false);


   const leftTestHandler = () => {
      setLeftTestEnabled(false);
      setRightTestEnabled(true);
   }

   const rightTestHandler = () => {
      setRightTestEnabled(false);
      setLeftTestEnabled(true);
   }

   return (
      <div>
         <div className={leftTestEnabled ? "leftTest" : "leftTest gray"} onClick={leftTestHandler}>LEFT</div>
         <div className={rightTestEnabled ? "rightTest" : "rightTest gray"} onClick={rightTestHandler}>RIGHT</div>
      </div>
   )
}

export default TestPage;
